import { Text, TextInput, View } from 'react-native';
import styles from '../styles/ButtonsStyle';

const TextBox= () => {
  return (
    <View style={styles.viewContainer}>
      <TextInput placeholder="Hej"></TextInput>
    </View>
  )
}
export default TextBox;
